function WorldMap_(p: Props) {
  const {className} = p

  const data = useMemo(() => {
    const list: Gateway[] = []
    for (let i = 0; i < 10; i++) {
      list.push({
        style: {left: `${Math.round(Math.random() * 80) + 10}%`, top: `${Math.round(Math.random() * 80) + 10}%`}
      })
    }
    return list
  }, [])
  return <div className={className}>
    <MapSvg/>
    {
      data.map((item, index) =>
        <div className="gateway" style={item.style} key={`gateway_${index}`}>
          <div className="dot_anim"/>
          <div className="dot"/>
        </div>)
    }

  </div>
}

export const WorldMap = React.memo<Props>(styled(WorldMap_)`
  width: 80%;
  margin-left: 20%;
  position: relative;

  svg:first-child {
    width: 100%;
    height: auto;

    g {
      fill: #12281a;
    }
  }

  @keyframes dotAnim {
    from {
      left: -0.3rem;
      top: -0.3rem;
      width: 0.6rem;
      height: 0.6rem;
      opacity: 1;
    }
    to {
      left: -2rem;
      top: -2rem;
      width: 4rem;
      height: 4rem;
      opacity: 0.1;
    }
  }

  .xy1 {
    left: 10%;
    top: 40%;
  }

  .xy2 {
    left: 20%;
    top: 40%;
  }

  .xy3 {
    left: 30%;
    top: 40%;
  }

  .xy4 {
    left: 40%;
    top: 40%;
  }

  .gateway {
    position: absolute;
    overflow: visible;
    width: 0;
    height: 0;
    z-index: 10;


    .dot_round {
      z-index: 4;
      position: absolute;
      left: -2rem;
      top: -2rem;
      width: 4rem;
      height: 4rem;
      border-radius: 2rem;
      border: solid 0.2rem #0c8cac;
      background-color: rgba(12, 140, 172, 0.4);
    }

    .dot_anim {
      animation: dotAnim 1s linear infinite;
      z-index: 5;
      position: absolute;
      left: -2rem;
      top: -2rem;
      width: 4rem;
      height: 4rem;
      border-radius: 2rem;
      border: solid 0.2rem #0c8cac;
      background-color: rgba(12, 140, 172, 0.4);
    }

    .dot {
      z-index: 6;
      position: absolute;
      left: -0.3rem;
      top: -0.3rem;
      width: 0.6rem;
      height: 0.6rem;
      border-radius: 0.5rem;
      background-color: #0c8cac;

    }
  }

  @media screen and (max-width: 80rem) {
    .gateway {
      transform: scale(0.8);
    }
  }
  @media screen and (max-width: 60rem) {
    .gateway {
      transform: scale(0.6);
    }
  }
  @media screen and (max-width: 40rem) {
    .gateway {
      transform: scale(0.4);
    }
  }
`)

export default WorldMap
